// src/App.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ScrollToTopButton from './components/ScrollToTopButton';  // Importa el componente ScrollToTopButton

import Header from './components/Header';  // Asegúrate de tener el Header
import Footer from './components/Footer';  // Asegúrate de tener el Footer
import Eneagrama from './pages/Eneagrama';  // Rutas y páginas de tu app
import Coaching from './pages/Coaching';  // Rutas y páginas de tu app

function App() {
  return (
    <Router>
      <Header />  {/* Tu header */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/eneagrama" element={<Eneagrama />} />
        <Route path="/coaching" element={<Coaching />} />
        {/* Agrega más rutas según sea necesario */}
      </Routes>
      <Footer />  {/* Tu footer */}
      <ScrollToTopButton />  {/* El botón flotante */}
    </Router>
  );
}

export default App;
